import React from "react";
import { VideoButton } from "arclight-react";

export default function VButton(props) {
  return (
    <div className="col-lg-8">
      <div style={{ padding: "0px 5px 0px 0px" }}>
        <div
          data-aos="fade-right"
          style={{
            backgroundPosition: "center",
            backgroundSize: "cover",
            height: "300px",
            overflow: "hidden"
          }}
        >
          <a href="new-member.html">
            <VideoButton
              style={"a"}
              data={{
                src: props.src,
                type: "video/mp4"
              }}
            />
            <div
              className="GoldBkg"
              style={{
                height: "80px",
                position: "absolute",
                top: "0",
                width: "100%"
              }}
            >
              <div className="BlockTitle">
                <i className="fas fa-user-plus" style="padding-right: 5px;"></i>
                New Members
              </div>
              <div className="BlockText">
                New to TES? Click here to get a valet tour of what we offer.
              </div>
            </div>
          </a>
        </div>
      </div>
    </div>
  );
}
